issue.body:
Currently, it is very difficult to access the IllustrateMessage as noData aggregation in the UploadSet.
In 1.119 only following properties are available:

- noDataDescription
- noDataIllustrationType
- noDataText

Developers need to be able to change the size, illustration etc. of the IllustratedMessage inside. I have found a workaround but that is certainly not ideal:
`let oList = this.byId("uploadSet").getDependents()[0];
let oIllustratedMessage = new IllustratedMessage({
    illustrationSize: IllustratedMessageSize.Dot,
    illustrationType: IllustratedMessageType.NoMail,
    title: 'No Data'
});
oList.setAggregation("noData", oIllustratedMessage);
`

The UI5 API should make this straightforward, also for at least version 1.108 which is Long-term Maintenance, Q4/2027.

